import React from 'react';
import './App.css';

class App extends React.Component {

	constructor(){
		super();
		this.state={
			login:true,
			signup:false
		};
	}

	render(){
		return (
		<div className="main-container">
			<div className="buttons">
				<p className="login">Login</p>
				<p className="login">Signup</p>
			</div>
			{this.state}
		</div>
		);
	}

}

export default App;
